import React from 'react';
import { FooterContainer, FooterSection, FooterWrapper, Waves } from './footer.styles';

const Footer = () => {
	return (
		<div>
			<Waves />
			<FooterContainer>
				Footer
				<FooterWrapper>
					<FooterSection>Footer Section</FooterSection>
				</FooterWrapper>
			</FooterContainer>
		</div>
	);
};

export default Footer;
